import React from 'react'
import {Typography, Alert, AlterTitle} from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';


function Summary() {
	return (
		<Alert severity="info">
		  <AlertTitle>You currently have no accounts.</AlertTitle>
		  Press the 'add' button to connect your first current account.
		</Alert>
	)
}

export default Summary;
